// src/components/dashboard/PredictionHistory.jsx
import React from "react";

const PredictionHistory = ({ history }) => {
  if (!history?.history || history.history.length === 0) return <p>No prediction history found.</p>;

  return (
    <div className="mb-6 p-4 bg-white rounded shadow">
      <h3 className="mb-3 font-semibold text-lg">Prediction History</h3>
      <ul className="space-y-2 max-h-48 overflow-y-auto">
        {history.history.map((item) => (
          <li key={item.id} className="border-b py-2">
            <p><strong>Date:</strong> {new Date(item.predicted_at).toLocaleString()}</p>
            <p><strong>Risk %:</strong> {item.risk_percentage}%</p>
            <p><strong>Category:</strong> {item.risk_category}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PredictionHistory;
